#!/bin/bash
# DO NOT CHANGE ANYTHING IN THIS FILE, ESPECIALLY, DO NOT ADD LINES!
echo "This small script downloads the SemEval data and combines it with the emotion annotations."
echo "For more information, please refer to our paper which is bundled with this script."
echo "If you have questions, please contact annonymous@for.review"
echo ""

# execute the following commands on a shell to build the annotated data file
if [[ -e 'stancedataset.zip' ]] ; then 
 echo "stancedataset.zip exists" ; else 
echo "Downloading stancedataset.zip ..." ; 
wget http://alt.qcri.org/semeval2016/task6/data/uploads/stancedataset.zip
echo "Done."
fi

# unzip this file
echo "Unzipping..."
unzip stancedataset.zip
echo "Done."

# reorganizing the original data
export LC_ALL=C
tr '\r' '\n' < StanceDataset/train.csv | grep -v "Tweet,Target,Stance,Opinion Towards,Sentiment" > train.csv
tr '\r' '\n' < StanceDataset/test.csv | grep -v "Tweet,Target,Stance,Opinion Towards,Sentiment" > test.csv

# prepare annotation data
tail -n +58 $0 > annotations2

head -n 2914 annotations2 > trainannot.tmp
tail -n +2915 annotations2 > testannot.tmp

paste train.csv trainannot.tmp > emotioncorpus-train.csv
paste test.csv testannot.tmp > emotioncorpus-test.csv

# remove temporary data, but keep the original zip file
rm -r __MACOSX
rm -r StanceDataset
rm train.csv
rm test.csv
rm -r annotations2
rm trainannot.tmp
rm testannot.tmp

echo "\n\nDONE!"
echo "The train and test data are now merged in emotioncorpus-train.csv and emotioncorpus-test.csv"
echo "The first part of the file is the original data followed by the emotion annotations. "
echo "These are 6 times 8 columns, a group of eight columns correspond to annotations for each annotator, the order is"
echo "Anger Anticipation Disgust Fear Joy Sadness Surprise Trust"
echo "A 1 denotes that this emotion is expressed in the Tweet (according to this annotator)."
echo "A 0 denotes that this emotion is not expressed in the Tweet (according to this annotator)."
echo "A -1 denotes that this text was not annotated by this annotator."
echo ""
echo ""

exit

